import DateTime from "../NewTask/DateTime";
import "./ConsultantPage.css";
import React from "react";
import taskIcon from "../Asset/taskIcon.png";
import { Routes, Route } from "react-router-dom";
import {useLocation, useNavigate} from "react-router";
import ConsultantOverview from "./ConsultantOverview";

function Consultant() {
  let location= useLocation();
  console.log(location.state);

  let navigate = useNavigate();
  function returnToLogin() {
    navigate("/");
  }
  return (
    <div className="Consultant">
      <Routes>
        <Route
          path="/Consultant"
          element={
            <>
              <div id="headingConsultant">
                <div id="titleConsultant"> <p> Hello Dr. {}, </p> Here is a summary of all the tasks:  </div>
                <div id="taskIconC">
                  <DateTime />
                  <img
                      src={taskIcon}
                      height={75}
                      alt="taskIcon"
                      id="taskIconImgC"
                  />
                </div>
              </div>

              <>
                <div id="actionButtonsC">
                  <button id="signOutConsultant" onClick={returnToLogin}>
                    {" "}
                    Sign Out
                  </button>
                </div>
              </>
              <ConsultantOverview name={location.state.name} login={returnToLogin}/>
            </>
          }
        />
      </Routes>
    </div>
  );
}

export default Consultant;
